local ipairs=ipairs
local GetLWEffect=DAoCBuff.GetLWEffect
local Filters={}
DAoCBuff.Filters=Filters

function Filters.G7ffffffffffff(enda,keep,conditions)
	local function func(i,k,item)
			return enda,keep,item
	end
	return func
end

function Filters.G7tfffffffffff(enda,keep,conditions,arg)
	local data=arg
	local function func(i,k,item,typ,delay,d)
			if(data.entries[i]==nil)
			then
				data.stackCount=data.stackCount+1
			end
			if(item==nil)
			then
				item=GetLWEffect(d,k,typ,delay)
			end
			data.entries[i]=item
			data.tracker.CondenseGlobal[i]=item
			return enda,keep,item
	end
	return func
end

function Filters.G7ffftffffffff(enda,keep,conditions,arg)
	local data=arg
	local function func(i,k,item,typ,delay,d)
			if(item==nil)
			then
				item=GetLWEffect(d,k,typ,delay)
			end
			if(data.borderC)then item.borderC=data.borderC end
			if(data.iconC)then item.iconC=data.iconC end
			return enda,keep,item
	end
	return func
end

