function Filters.G7ffffffttffft(enda,keep,conditions,arg,externalC)
	local tmp
	local l
	local external={}
	for _,j in ipairs(externalC)
	do
		local last=_G
		local delay="_G"
		for _,l in ipairs(j[1])
		do
			if(last[delay]==nil)then break 
			else
				last=last[delay]
				delay=l
			end
		end
		if(last[delay]~=nil)
		then
			local pack={}
			pack[1]=last
			pack[2]=delay
			pack[3]=j[2]
			table.insert(external,pack)
		end
	end
	local function func(i,k,item)
