	local l
	local external={}
	for _,j in ipairs(externalC)
	do
		local last=_G
		local delay="_G"
		for _,l in ipairs(j[1])
		do
			if(last[delay]==nil)then break 
			else
				last=last[delay]
				delay=l
			end
		end
		if(last[delay]~=nil)
		then
			local pack={}
			pack[1]=last
			pack[2]=delay
			pack[3]=j[2]
			table.insert(external,pack)
		end
	end
	local function func(i,k,item)
		tmp=false
		for j,l in ipairs(conditions)
		do
			if(k[l[2]]==l[3])then tmp=true;break end
			
		end
		if(tmp)
		then
			for _,l in ipairs(external)
			do
				if(l[1][l[2]]==l[3])then tmp=true;break end
			end
		end
		if(not tmp)
		then
			return enda,keep,item
		end
		return false,true,item
	end
	return func
end

